import React, { Component } from 'react';
import io from 'socket.io-client';

class App extends Component {
  constructor() {
    super();

    this.state = {
      endpoint: "http://localhost:5000"
    };

    this.createConnection();
  }

  createConnection = () => {
    this.socket = io(this.state.endpoint);

    this.socket.on('data', data => {
      console.log(data);
    });
  }

  render() {
    return (
      <div>
        <h1>Hello!</h1>
      </div>
    );
  }
}

export default App;
